import React from 'react';
import {Form,Button} from 'react-bootstrap'

function CreatePost() {
    return (
        <div>
           <form>
               <label>Username</label>
               <input type="text"></input><br></br>
               <label>Image</label>
           </form>
        </div>
    )
}

export default CreatePost
